INSERT INTO `artist` VALUES (1,'Albrecht_Du_rer','북르네상스','독일','알브레히트 뒤러(독일어: Albrecht D?rer, 1471년 5월 21일 - 1528년 4월 6일)는 독일의 화가, 판화가, 조각가다. 르네상스의 대표적 화가이며, 특히 목판화, 동판화 및 수채화에서 독창적 재질을 보였다.','1471 - 1528','그는 르네상스 최성기에 이탈리아에 유학하여 그 영향을 받았으나, 뒤에 독자적인 화풍을 창조하고, 북유럽적·독일적인 미의 전통을 쌓은 화가이다. 이론적 연구에도 뛰어나 <인체 비례론> 및 <원근법에 관한 고찰> 등의 저서도 내고, 또 이상미(理想美)에 관하여도 논하였다. 수채화의 새로운 분야를 개척하였으며, 인문주의와 종교 개혁에도 밀접한 관계를 가졌다. 주로 종교화·초상화·풍경화 등을 제재로 하였으며, 동판·목판 등 판화에도 뛰어난 작품을 남겼다. 작품으로 <아담과 이브> <동방 세 박사의 예배> <자화상> <요한 묵시록> 등이 있다'),(2,'Alfred_Sisley','인상주의','프랑스,영국','알프레드 시슬레(Alfred Sisley, 1839년 10월 30일 1899년 1월 29일)는 잉글랜드인으로 프랑스에서 활동한 인상주의 풍경 화가이다.','1839 - 1899','시슬레의 가장 유명한 작품은 시카고 미술관이 소장하고 있는 \"모레의 길\"(Street in Moret)과 \" \n모래더미\"(Sand Heaps)와 파리 오르세 미술관에 있는 \"모레 쉬르 루앙의 다리\"(The Bridge at Moret-sur-Loing) \"모레의 포플러길\"(All?e des peupliers de Moret)은 니스 미술관에서 3번이나 도둑맞았다. 1978년에는 마르세유에서 빌려갔 \n을 때에(며칠 뒤 도시 하수도에서 발견되었다.), 1998년에는 공범자 2명과 함께 미술관의 큐레이터가 절도죄로 5년간 감옥에 갇혔고, 2007년에도 사라졌으나 다시 발견되었다.[5]'),(3,'Amedeo_Modigliani','표현주의','이탈리아','아메데오 모딜리아니(이탈리아어: Amedeo Clemente Modigliani, 1884년 7월 12일 ~ 1920년 1월 24일)는 이탈리아의 화가이다.','1884 - 1920','1884년 이태리 토스카나주 리보르노에 있는 유태인 가정에서 태어났다. 그의 어머니 에우제니아는 철학자 스피노자의 혈통을 이어받은 마르세유의 명문가 출신으로 높은 지성과 교양을 갖추고 있었다. 부친의 사업이 어려워지자 직접 단눈치오의 시를 번역하거나 서평을 써 생활을 유지할 정도였다. 모딜리아니가 태어났을 당시 아버지의 사업 실패로 집안은 어려웠지만 에우제니아는 어린 시절부터 그림에 대한 재능을 보인 아들을 굴리엘모 미켈리의 아틀리에에 데리고 가기도 했다. 그러나 모딜리아니는 늑막염, 폐결핵, 폐렴 등 병치레가 잦아 평생을 고통받았다. 14세에는 병으로 학교를 그만두었고, 17세에는 결핵에 걸려 이탈리아 여기저기를 돌아다니며 요양을 해야 했다. 베네치아·피렌체 미술 학교에서 공부한 모딜리아니는 1906년 파리로 나가 몽마르트르에 아틀리에를 빌렸고 세잔의 영향을 받았다. 독립 미술파에 속하며, 파리 화단의 특이한 화가로서 인정되었다. 조각도 하여, 브랑쿠시, 콕토 등과도 사귀었다. 그러나 돌조각에서 나오는 먼지로 폐가 나빠지자 조각을 그만두고 그림만 그렸다. 1912년 파리 가을 미술전에 작품을 출품했지만 주목받지 못했고 초상화 한 점 당 10프랑밖에 받지 못했다. 그러나 미남으로 유명했던 모딜리아니에겐 모델을 자청하는 여성들이 많이 있었다. 1917년 몽파르나스의 카페에서 모딜리아니는 러시아 조각가 차나 오를로프(Chana Orloff)의 소개로 14세 연하의 화가 지망생 잔 에뷔테른(Jeanne Ebuterne)을 만났다. 잔은 모딜리아니와 같은 아틀리에를 쓰는 일본인 화가 후지타 쓰구하루의 모델이었다. 보수적인 부르주아 가정이었던 잔의 가족은 가난하고 병약하며 마약을 하는 유대인 모딜리아니와의 교제를 싫어했지만 두 사람은 동거에 들어갔다. 같은 해 모딜리아니는 폴란드 화상 레오폴트 즈보로프스키의 주선으로 개인전을 열었지만 외설적이라는 비판만 받은 채 전시회는 실패로 돌아갔다. 이듬해인 1918년 모딜리아니는 잔과 니스에서 요양을 했고 딸 지오바나를 얻었다. 1920년 파리로 돌아온 모딜리아니는 자선 병원에서 결핵성 뇌막염으로 34세에 요절하였다. 당시 임신 8개월째였던 잔은 모딜리아니가 죽고 이틀 뒤에 투신 자살했다. 모딜리아니는 파리의 페르 라 셰즈 묘지에 묻혔고, 10년 뒤 잔의 가족들은 잔을 모딜리아니 곁에 묻어주었다.'),(4,'Andrei_Rublev','비잔틴 미술','러시아','안드레이 루블료프(러시아어: Андре?й Рублёв, Andrei Rublev, Andrey Rublyov[1], 1360년대 ~ 1427/1430년 1월 또는 1428년 10월 17일 모스크바)는 동방 정교회 성화, 프레스코에 참여한 중세 러시아의 화가 가운데 하나이다.','1360 - 1430','루블료프는 1430년 1월 29일(또는 1428년 10월 17일) 안드로니코프 수도원에서 사망하였다. 루블료프의 작품은 디오니시를 포함한 수많은 예술가에게 영향을 주었다.'),(5,'Andy_Warhol','팝 아트','미국','앤드루 워홀라 주니어(영어: Andrew Warhola Jr., 1928년 8월 6일 ~ 1987년 2월 22일)는 앤디 워홀(영어: Andy Warhol )이라는 예명으로 활동했던 미국의 미술가이자, 출력물 제작자, 그리고 영화 제작자다. 시각주의 예술 운동의 선구자로, 팝 아트로 잘 알려진 인물이다. 산업 일러스트로 성공적인 경력을 쌓은 후에 화가, 아방가르드 영화, 레코드 프로듀서, 작가로서 세계적으로 유명해졌다.','1928  1987','가장 높은 가격을 기록한 워홀의 그림은 1963년에 제작된 캔버스로 1억 달러에 거래된 《여덟 명의 엘비스》(Eight Elvises)라는 제목의 그림이다. 개인적으로 거래된 이 사실은 《이코노미스트》의 기사를 통해 알려졌다. 이코노미스트는 미술 시장의 주도자로서 워홀의 지위를 설명한 것이다.[1] 1억 달러라는 가격은 잭슨 폴록, 파블로 피카소, 구스타프 클림트와 윌렘 드 쿠닝만이 기록한 기준 가격이다.'),(6,'Camille_Pissarro','인상주의,후기-인상주의','프랑스','카미유 피사로(프랑스어: Camille Pissarro, 1830년 7월 10일 ~ 1903년 11월 13일)는 덴마크계 프랑스인의 인상주의 화가다. 가장 훌륭한 근대 풍경화가 가운데 한 사람이며, 감정은 섬세하고, 초기 농원(農園)의 연작(連作) 또한 아름다운 매력이 있다','1830 - 1903','덴마크령 서인도 제도중 하나였던 세인트토머스섬(현재의 미국령 버진아일랜드)에서 태어났으며 12세 때에 프랑스 파리로 나가 도화(圖畵)를 익힌 다음 회화에 뜻을 두고 1855년에 재차 동경하던 파리에 나타났다. 처음에는 코로와 도비니(Charles-Fran?ois Daubigny)의 풍경화에 매력을 느꼈고 연구소에서 모네와 세잔을 알게 되며 그 후에도 야외에 나가 햇볕 아래에서 풍경 그리기에 열중한다. 그는 루브센에 주거를 두고, 보불전쟁이 시작되자 전화(戰禍)를 피하여 런던으로 가서 거기서 다시금 모네를 만난다. 두 사람은 런던에서 터너를 만나서 빛의 표현에 대한 지도를 받고 인상파의 표현을 완성시켰다. 그러나 전후 귀국해 보니 그의 집은 전화로 황폐되어 있었다. 피사로는 얼마 동안 퐁토아스에 살며 거기서 세잔을 만나 그를 인상파의 표현을 끌어들였다. 거기에서 1874년에 친구들과 더불어 인상파 전람회를 결성했다. 피사로는 인상파전(印象派展)의 중심인물이 되어 그의 생애는 인상파적인 그림 제작으로 일관했다. 만년에는 루앵 항구나 파리의 오페라가(街) 등의 풍경을 그렸다.'),(7,'Caravaggio','바로크','이탈리아','미켈란젤로 메리시 다 카라바조(이탈리아어: Michelangelo Merisi da Caravaggio [kara?vadd?o][*], 1573년 9월 29일 ? 1610년 7월 18일)는 이탈리아 밀라노 출신의 화가이다. 태어난 마을의 이름인 카라바조(Caravaggio)로 잘 알려져 있다.','1571 - 1610','그의 삶은 불가사의하고 매혹적이며 위험했던 것으로 여겨진다. 그는 1600년 로마 미술계에 갑자기 등단했다. 그 이후 그는 어떠한 수입이나 후원자도 없었으나 그는 극적인 성공을 거두었다. 그러다가 1606년 5월 29일 테니스 경기도중 말다툼 끝에 상대인 젊은 남자를 살해하고 사형을 선고받았다. 그러나 그는 현상금이 걸린 채 로마를 도망쳐 나왔다. 이후에도 1608년 몰타에서 말다툼에, 1609년에 나폴리에서 또 다른 말다툼에 개입되었다. 이듬 해인 1610년에 그의 10여 년간의 활동을 뒤로한 채 포르토 에콜레(Porto Ecole)에서 사망하였다.\n\n사망 후 오랫동안 잊혀졌다가 20세기에 들어서 재발견되어 거장으로 재평가되었다'),(8,'Claude_Monet','인상주의','프랑스','클로드 모네(프랑스어: Oscar-Claude Monet, 1840년 11월 14일 - 1926년 12월 5일)는 프랑스의 인상주의 화가로, 인상파의 개척자이며 지도자다.','1840 - 1926','1840년 프랑스 파리에서 상인의 아들로 태어났다. 소년 시절을 르아브르에서 보냈다 그곳에서 부댕의 문하생이 되어 정식 미술 교육을 받게 되었다. 그 후 1859년 파리로 나가 피사로·시슬레·르누아르·바지유 등과 사귀게 되었다. 마네의 밝은 화풍에 끌려 밝은 야외 광선 묘사에 주력하였다. 마네를 중심으로 르누아르 및 피사로·드가·세잔 등과 함께 신예술 창조에 전력하였다. 1871년, 보불전쟁 중에는 런던으로 건너가, 그곳에서 터너 등의 작품에 영향을 받아 더욱 밝은 색조에 대한 연구를 하게 되었다.\n\n귀국 후, 1874년 동료 화가들과 함께 제1회 인상파 전람회를 개최하였다. 그러나 출품된 작품이 물체 본래의 색깔을 쓰지 않고, 신선하고 밝은 색채로만 그려진 데 대해 비난과 공격이 쏟아졌다. 특히 모네의 〈인상, 해돋이〉가 가장 심한 비난을 받았는데, \'인상파\'라는 말은 이때 모네의 작품을 야유한 데서 나온 말이다.'),(9,'Diego_Rivera','사회 현실주의,벽화주의','멕시코','디에고 리베라(Diego Rivera,?1886년?~?1957년)는?멕시코의?화가이다.','1886 - 1957','과나후아토주(州)에서 출생하여 멕시코 시에 있는 국립 미술학교에서 배운 후에 에스파냐·프랑스·벨기에·네덜란드·영국·포르투갈로 연구 여행을 하고 1910년 파리에 정주하였다. 그는 모딜리아니와 친교를 맺고 또 바토 라부아르(洗濯船)의 전위 화가인 피카소, 브라크, 그리스 등과 사귀어 1910년대의 큐비즘 운동에 참가하였으며 당시 시인 아폴리네르는 그의 열렬한 지지자이기도 하였다. 그러나 그는 결국 파리의 화단에 몸을 담지 못하고 1921년 멕시코로 고대 문화를 탐구하였고 또 당시 멕시코에 대두한 혁명적인 정신에 공명(共鳴)하여 참다운 민중화가로서 모든 계층이 이해하는 그림을 그리려고 결심하였다. 그러기 위하여 그는 한때 판화(板畵, tableau)를 그만두고 민중이 모이는 장소에 거대한 벽화(프레스코)를 그리는 일에 열중하였다. 문부성(文部省)·보건성·차핑고 농업학교·호텔·레폴마 등의 벽화는 1920년대에 제작한 작품이다. 그후 미국의 초청을 받아 샌프란시스코의 증권거래소와 디트로이트 미술학교에도 벽화를 그렸다'),(10,'Diego_Velazquez','바로크','스페인','디에고 로드리게스 데 실바 이 벨라스케스(스페인어: Diego Rodr?guez de Silva y Vel?zquez, 1599년 6월 6일 ~ 1660년 8월 6일)는 스페인의 화가이다. 대개 디에고 벨라스케스로 불린다.','1599 - 1660','바로크 시대 펠리페 4세(스페인어: Felipe IV) 궁정을 주도하던 화가였으며 초상화에 유능한 화가이기도 했다. 그는 1629년에서 1631년의 1년 반동안 미술 공부와 여행을 위해 이탈리아에서 살았다. 1649년 그는 다시 이태리로 여행을 떠났다. 그는 스페인 왕족 중 다수의 초상화를 그렸으며 유명한 유럽 의원을 비롯해 수많은 사람들의 그림을 그렸다. 그 작품의 절정은 그의 걸작 중의 걸작인 시녀들(스페인어: Las Meninas)(1656)이다.\n\n19세기의 초반 동안 벨라스케스의 작품은 다른 모든 인상주의 화가들과 사실주의 화가들의 귀감이 되었으며 마네 또한 그들 중 한 명이다.'),(11,'Edgar_Degas','인상주의','프랑스','에드가 드가(프랑스어: Edgar Degas 에드가르 드가[*] [?d??? d???], 1834년 7월 19일 ~ 1917년 9월 29일)는 프랑스의 유명한 화가이자 조각가이다.','1834 - 1917','드가는 인상주의의 창시자 중 한 사람으로 평가받고 있지만 그는 사실주의자라고 불리기를 선호했으며[1] 많은 인상주의 화가들이 그랬던 것처럼 야외에서 그림을 그리지 않았다. 드가는 뛰어난 데생 화가였으며 특히 무용수들의 무대나 목욕하는 여성의 누드화에서 볼 수 있듯이 움직임을 묘사하는 데 능숙했다. 드가는 발레 무용수들이나 목욕하는 여성들 외에도 경주마와 기수들, 초상화도 그렸다. 그의 초상화는 인간의 복잡한 심리와 외로움을 잘 묘사한 것으로 유명하다.[2] 활동 초기에 드가는 역사화가가 되기를 원했고, 미술학교에서의 엄격한 훈련과 면밀한 연구를 통해 역사화를 그리기 위한 준비를 한다. 그러나 그는 30대 초반에 진로를 바꿔 역사화가의 전통적인 기법을 당대의 주제에 적용시키면서 근대생활의 고전적인 화가가 되었다.'),(12,'Edouard_Manet','현실주의,인상주의','프랑스','에두아르 마네(프랑스어: ?douard Manet, 1832년 1월 23일 ~ 1883년 4월 30일)는 프랑스의 인상주의 화가이다. 19세기 현대적인 삶의 모습에 접근하려 했던 화가들중의 하나로 시대적 화풍이 사실주의에서 인상파로 전환되는 데 중추적 역할을 하였다. 그의 초기작인 <풀밭 위의 점심 식사>와 <올랭피아>는 엄청난 비난을 불러 일으켰으나 반면에 수많은 젊은 화가들을 주변에 불러모으는 힘이 되었는데, 이들이 후에 인상주의를 창조하였다. 이 그림들은 오늘날 현대미술을 창시한 분수령으로 여겨진다. 그의 화풍의 특색은 단순한 선 처리와 강한 필치, 풍부한 색채감에 있다.','1832 - 1883','1845년에 롤랑 기숙학교에 입학하였는데 여기서 미래의 예술부 장관이자 그의 평생의 친구인 앙토닌 프루스트를 만난다. 마네는 그렇게 공부를 잘하는 학생이 아니어서, 집안의 바람대로 법대에 진학하는 것은 무리였다. 해서 1848년에 아버지의 바람으로 해군 사관학교에 지원하였으나 낙방하였다. 같은 해 10월 프랑스의 해군 사관학교는 6개월간 견습항해시 항해 참가원끼리의 경쟁으로 생도를 뽑는 제도를 마련한다. 이에 마네는 리우데자네이루로 항해하는 배에 올라 항해를 하기도 하였다. 실패를 거듭하자 아버지는 마네가 하고 싶어 하는 미술을 교육받는 것을 허락하였다. 마네는 1850년에서 1856년까지 아카데미 파로서 커다란 역사화를 여럿 그린 화가 토마스 쿠튀르르 문하에서 공부하면서 남는 시간에 루브르 박물관에 전시된 걸작들을 따라 그리며 공부했다.'),(13,'Edvard_Munch','상징주의,표현주의','노르웨이','에드바르 뭉크(노르웨이어: Edvard Munch, 1863년 12월 12일 ~ 1944년 1월 23일)는 노르웨이 출신의 표현주의 화가이자 판화 작가이다.','1863 - 1944','노르웨이에서는 국민적인 화가이다. 그의 초상이 1,000 크로네 지폐에도 그려져 있다.\n\n처음에는 신(新)인상파의 영향을 받아 점묘의 수법을 사용하여 삶과 죽음에의 극적이고 내면적인 그림을 그렸다. 1892년 베를린으로 이주, 그곳의 미술 협회에 출품했다. 그는 나면서부터 몸이 약해 작품에도 그 영향이 드러나 있는데, 나치스는 퇴폐예술이라는 이유로 그의 그림을 몰수하기도 했다. 작품으로 <절규>, <병든 소녀> 등이 있다.\n\n생과 죽음의 문제 그리고 인간 존재의 근원에 존재하는 고독, 질투, 불안 등을 응시하는 인물을, 인물화를 통해 표현했다. 표현주의적인 화풍의 화가로 알려져 있다.\n\n스웨덴-노르웨이 로이텐에서 태어났으며, 아버지는 빈민가에 사는 의사였다. 그 빈민가의 절실한 생활은 그의 마음에 새겨졌으며, 어릴 때에 어머니는 결핵으로 사별하고, 이어 누나까지 죽음을 당한 것으로 인하여, 죽음과 병의 환각은 그의 성벽으로까지 되었다. 그는 파리에도 나와 인상파의 영향을 받음으로써 색채를 강하게 바꾸어 그리고 있다. 또 1892년에는 베를린 미술협회에 초청되어 대량의 작품을 출품했으나 그 이질적인 표현으로 공격을 받고, 다시 개인전을 개최하였다.'),(14,'El_Greco','매너리즘','스페인,그리스','엘 그레코(스페인어: El Greco, 1541년 ~ 1614년 4월 7일)는 그리스 크레타섬에서 태어난 그리스의 화가로, 본명은 도미니코스 테오토코풀로스(그리스어: Δομ?νικο? Θεοτοκ?πουλο?)이다','1541 - 1614','그리스인이지만 스페인에서 주로 활동했다. \"\"엘 그레코\"\"는 포스트 르네상스 시절의 미술의 중심지가 이탈리아였던 시대 상황에 맞게, 그리스인인 그에게 \"\"그리스인\"\"이라는 말을 이탈리아식으로 부른 데서 기인한다(그의 주무대였던 스페인식으로 부른다면 \"\"엘 그리에고\"\"이겠다).\n\n그리스의 크레타 섬에서 태어나, 처음에는 비잔틴 회화를 배웠다. 20세 무렵에 이탈리아에 가서 베네치아파(派) 화가인 티치아노, 틴토레토 등에게서 풍부한 색채를 배웠으며, 코레조로부터는 깊이 있는 명암에 의한 정서적 작품의 영향을 받았다. 1577년에 스페인 톨레도로 이주한 후 종교적인 주제의 그림 속에서 독창적인 작품을 시작하였으며, 선명한 색과 그늘진 배경의 대조, 긴 열굴 표현 등의 틀을 유지했다.\n\n대표적 작품에 <장님의 치료> , <에스폴리오>, <성 마우리티우스의 순교>, <오르가스 백작의 매장>, <목자들의 경배> 등이 있고, 풍경화 <톨레도의 풍경>과 <자화상>이 있다.\n'),(15,'Eugene_Delacroix','낭만주의','프랑스','외젠 들라크루아(프랑스어: Eug?ne Delacroix, 1798년 4월 26일 ~ 1863년 8월 13일)는 프랑스 낭만주의의 중요한 화가이다.[1] 19세기 낭만주의 예술의 최고 대표자로 손꼽힌다.','1798  1863','작품의 소재는 종교·신화·문학·역사에서부터 현실의 풍속·인물·풍경·정물 등 다양하다. 벽화·장식을 포함한 유화 외에 데생·수채화·파스텔 화·판화 등 방대한 작품을 제작하였다. 또한, 그는 예술에 관한 깊은 생각과 관찰을 일기·평론·편지 등에 많이 기록하여 남겼다. 그의 작품에는 자연을 구사하여 현실을 초월한 진실 속에 상상 세계에서의 인간의 모습과, 영웅적인 모습이 되려고 노력하는 인간의 표상이 담겨 있다.[2]'),(16,'Francisco_Goya','낭만주의','스페인','프란시스코 호세 데 고야 이 루시엔테스(스페인어: Francisco Jos? de Goya y Lucientes [f?an?θisko xo?se ðe ??o?a i lu?θjentes][*], 1746년 3월 30일 - 1828년 4월 16일)는 스페인의 대표적인 낭만주의 화가이자 판화가이다. 고야는 궁정화가이자 기록화가로서 많은 작품을 남겼다.','1746 - 1828','18세기 스페인 회화의 대표자로 특히 고전적인 경향에서 떠나 인상파의 시초를 보인 스페인 근세의 천재 화가로 알려져 있다. 파괴적이고 지극히 주관적인 느낌과 대담한 붓터치 등은 후세의 화가들, 특히 에두아르 마네와 파블로 피카소에게 많은 영향을 주었다'),(17,'Frida_Kahlo','원시주의,초현실주의','멕시코','프리다 칼로 드 리베라(스페인어: Frida Kahlo de Rivera, 1907년 7월 6일 ~ 1954년 7월 13일)는 멕시코의 초현실주의 화가이자 공산주의자이다.','1907 - 1954','출생 시의 이름은 마그달레나 카르멘 프리다 칼로 이 칼데론(스페인어: Magdalena Carmen Frieda Kahlo y Calder?n)이며, 디에고 리베라와 결혼한 후에는 주로 프리다 칼로로 불렸다.'),(18,'Georges_Seurat','후기-인상주의','프랑스','조르주 쇠라(프랑스어: Georges Seurat, 1859년 12월 2일~1891년 3월 29일)는 프랑스의 화가이자 신인상주의의 창시자이다','1859  1891','그의 가장 유명한 대작인 그랑드 자트 섬의 일요일 오후는 신인상주의의 시작으로 현대 예술의 방향을 바꾸었고, 19세기 회화의 하나의 상징이 되었다.'),(19,'Giotto_di_Bondone','프로토 르네상스','이탈리아','조토 디 본도네(Giotto di Bondone, 1267년 ~ 1337년 1월 8일)는 이탈리아의 화가·건축가이다. 피렌체 근교의 끌레 디 베스피자노에서 탄생했으며 피렌체에서 당대의 유명한 화가인 치마부에에게서 미술을 배웠다. 이탈리아 르네상스 미술의 선구자로서 비잔틴 양식에서 벗어나 피렌체 파를 형성하였다. 마침내 투시법에 의한 공간의 묘사에 성공하였으며, 생기 있는 묘사로 종교 예술의 신경지를 개척하였다.','1266 - 1337','그의 명성은 살아있을 때는 물론 후대에도 친송을 받았는데 동시대의 사람인 단테(1265-1321)는 \'치마부에의 시대는 갔다. 지금부터는 지오토의 시대다\'라고 극찬했고[1], 조반니 보카치오(1313-1375)는 지오토가 \'수세기동안 어둠 속에 갇혀 있었던 회화예술에 빛을 던진 사람\' 이라고 높이 평가했다.[2]\n\n프란체스코 성당의 벽화 <성프란체스코전>에 참여해 28점중 일부의 벽화를 그렸다. 그 후 1303~1305년까지 그의 대표작이라 할 수 있는 파도바의 아레나 예배당이라고도 불리는 스크로베니 예배당의 장식을 맡는다. 3개의 층으로 나뉜 38개의 구획들은 성가족과 예수의 일생을 그린 프레스코화로 채워져 있다. 그 중 서쪽 벽 전체를 차지하고 있는 <최후의 심판>(1305년, 프레스코)과 벽면 패널 중 하나인 <애도(Lamentation)>(1304년, 프레스코)는 조토의 정수를 나타내는 그림을 평가받는다. 후기의 대작으로서 피렌체의 온니산티 성당의 <장엄한 성모>(1331년, 템페라), 산타마리아 노벨라 성당의 <예수의 십자가> 등이 있으며 1334년에는 피렌체 산타 마리아 델 피오레 대성당의 주임 건축가로 임명되어 종탑 건조에 착수했으나 완성하지 못하고 중도에 사망하였다.'),(20,'Gustav_Klimt','상징주의,아르누보','오스트리아','구스타프 클림트(독일어: Gustav Klimt, 1862년 7월 14일 ~ 1918년 2월 6일)는 오스트리아의 상징주의 화가이자 빈 분리파 운동의 주요 회원이다.','1862 - 1918','클림트는 회화, 벽화, 스케치 등의 작품을 남겼다. 작품의 주요 주제는 여성의 신체로[1], 그의 작품은 노골적인 에로티시즘으로 유명하다.[2]\n\n1897년 ‘빈 분리파’를 결성하여 반(反) 아카데미즘 운동을 하였다. 1906년에는 ‘오스트리아 화가 연맹’을 결성하여 전시 활동을 시작하였다. 클림트는 빈 아르누보 운동에 있어서, 가장 두드러진 미술가 중 하나였다. 한국에서는 \'유디트\', \'베토벤 프리즈\'를 비롯한 200여점이 예술의 전당 한가람미술관에서 2009년 2월 ~ 5월 간 전시되었다.'),(21,'Gustave_Courbet','현실주의','프랑스','외젠 들라크루아(프랑스어: Eug?ne Delacroix, 1798년 4월 26일 ~ 1863년 8월 13일)는 프랑스 낭만주의의 중요한 화가이다.[1] 19세기 낭만주의 예술의 최고 대표자로 손꼽힌다.','1819 - 1877','작품의 소재는 종교·신화·문학·역사에서부터 현실의 풍속·인물·풍경·정물 등 다양하다. 벽화·장식을 포함한 유화 외에 데생·수채화·파스텔 화·판화 등 방대한 작품을 제작하였다. 또한, 그는 예술에 관한 깊은 생각과 관찰을 일기·평론·편지 등에 많이 기록하여 남겼다. 그의 작품에는 자연을 구사하여 현실을 초월한 진실 속에 상상 세계에서의 인간의 모습과, 영웅적인 모습이 되려고 노력하는 인간의 표상이 담겨 있다.[2]'),(22,'Henri_de_Toulouse-Lautrec','후기-인상주의','프랑스','앙리 드 툴루즈 로트레크(프랑스어: Henri de Toulouse-Lautrec, 1864년 11월 24일 ~ 1901년 9월 9일)는 프랑스의 화가이다.','1864  1901','남부 프랑스 알비의 귀족 집안에서 출생한 그는 본래 허약한데다가 소년 시절에 다리를 다쳐서 불구자가 되었다. 그는 화가가 될 것을 결심하고 그림에 몰두하였으며, 파리로 나가 미술 학교에 다녔다.'),(23,'Henri_Matisse','인상주의,후기-인상주의','프랑스','앙리 에밀브누아 마티스(Henri ?mile-Benoit Matisse, 1869년 12월 31일 - 1954년 11월 3일)는 20세기 야수파 프랑스 화가이다.','1869 - 1954','파블로 피카소와 함께 \'20세기 최고의 화가\'로 꼽힌다. 프랑스 북부 노르파드칼레의 르샤토캄프레시스에서 태어났다.\n\n22세 때 파리로 나가 그림 공부를 하고, 1893년 파리 국립 미술 학교에 들어가 구스타프 모로에게서 배웠다.\n\n1904년 무렵에 전부터 친분이 있는 피카소·드랭·블라맹크 등과 함께 20세기 회화의 제일보로 불리는 야수파 운동에 참가하여, 그 중심 인물로서 활약하였다.\n\n제1차 세계 대전 후에는 주로 니스에 머무르면서, 모로코·타히티 섬을 여행하였다. 타히티 섬에서는 재혼을 하여 약 7년 동안 거주하였다.\n\n말년에는 색도 형체도 단순화 되었으며, 밝고 순수한 빛의 광휘와 청순 명쾌한 선에 의하여 훌륭하게 구성된 평면적인 화면은 \'세기의 경이\'라고까지 평가되고 있다. 제2차 세계 대전 후에 시작하면서 1951년에 완성한 반(Vannes) 예배당의 장식은 세계 화단의 새로운 기념물이다.\n\n그는 조각·동판화에도 뛰어났고, 직물의 디자인, 삽화 등 새로운 분야도 만들었다. 그리고 대표작으로 <춤> <젊o o원>이 있다.'),(24,'Henri_Rousseau','원시주의','프랑스','앙리 루소(Henri Rousseau, 1844년 5월 21일 ~ 1910년 9월 2일)는 프랑스의 화가이다.','1844  1910','가난한 배관공의 자제로, 프랑스 마옌 데파르트망(Department) 라발에서 태어났다. 전문적인 미술 교육 없이, 파리 세관에서 세관원으로 근무하며 틈틈이 그림을 그리기 시작했다. 언제부터 어떠한 계기로 그림을 그리기 시작했는지 명확하지 않으나 30대 중반에 이미 환상과 전설, 원시성이 서식하는 이미지의 세계를 보여 주었다. 독학으로 주말마다 그림을 그렸기에 ‘일요화가’의 대명사로도 널리 알려져 있다. 그가 미술을 시작한 이 시기에 르 두아니에(Le Douanier:세관원)란 애칭을 얻게 되었다.\n\n1885년부터 살롱 드 샹젤리제에 2점의 작품을 출품한 이후 1886년 이후는 앙데팡당전과 살롱 도톤에 출품하였다.\n\n그의 작품은 초기에는 그가 독학으로 미술을 시작했다는 것과 어색한 인체 비례, 환상과 사실의 색다른 조합 등의 이유로 조소와 비난의 대상이 되었지만, 사후에 《경악(驚愕:숲속의 폭풍)》(1891) 《잠자는 집시》(1897) 《뱀을 부리는 여인》(1907) 《시인의 영감》(1909)과 같은 그의 그림은 참신성과 원시적인 자연스러움을 근거로 높이 평가되었다. 그의 원시림과 같은 원초적인 세계에 대한 동경과 환상성, 강렬한 색채는 현대예술의 거장 피카소, 아폴리네르 등에 영향을 크게 미쳤다고 알려져 있다.'),(25,'Hieronymus_Bosch','북르네상스','네덜란드','히에로니무스 보스(Hieronymus Bosch 또는 Jerome Bosch, 1450년경 ~ 1516년 8월)는 네덜란드의 화가이다. 상상 속의 풍경을 담은 작품들로 유명하다. 20세기 초현실주의 운동에 영향을 끼쳤다고 여겨진다.','1450 - 1516','판에이크 형제 이후의 대표적인 종교화가로 특이한 색채로 이상한 괴물, 납 속의 유령, 텅 비어 있는 눈과 특이한 몸을 가진 사람 등 무서운 지옥의 세계를 많이 그렸다.\n\n보스는 나무 판넬에 그려진 3개의 그림이 서로 맞붙은 3연작화를 여러 점 그렸다. 이 중에서 가장 유명한 작품은 《세속적인 쾌락의 동산》이다. 이 작품의 왼쪽 판넬에는 아담과 이브와 수많은 경이로운 동물을 담은 낙원을 묘사하며, 중간 판넬에는 다수의 벌거벗은 사람들과 거대한 과일 및 새를 담은 지상의 쾌락의 모습을 그리며, 오른쪽 판넬에는 다양한 종류의 죄인들을 향하여 공상의 징벌의 묘사를 그린 지옥의 모습을 담는다. 관람자가 볼 수 있는 외부 판넬이 닫힌 곳에, 그리사유 기법으로 신이 지구를 창조하는 모습이 그려졌다.\n\n보스의 그림은 채색의 방법에 의해 거친 표면을 가진다. 이는 전통적인 플랑드르 화풍 이 매끄러운 표면의 그림으로, 인간에 의한 것임을 숨기려 했던 것과 대조된다. 그의 그림에는 무서움이나 잔인한 모양 그리고 악덕과 범죄 등이 나타나 있다. 뛰어난 상상력으로써 많은 그림을 그렸는데 《환락의 땅》, 《성 안토니오의 유혹》 등이 유명하다.\n\n보스는 자신의 작품에 날짜를 기록한 적이 없으며, 몇 작품을 제외하고는 서명을 하지 않았다. 다른 서명들은 그가 직접 남긴 것이 아니다. 전체적으로 25개 미만의 그림이 오늘날 보스의 작품으로 여겨진다. 스페인의 펠리페 2세는 보스가 죽은 후, 그의 그림 다수를 획득하였다. 그 결과로 마드리드의 프라도 미술관은 이제 《세속적인 쾌락의 동산》을 비롯하여 보스의 작품 여러 점을 소유한다.\n\n처음에는 경시됐지만 후에는 그의 이상한 예술성이 대 피터르 브뤼헐 (1525? ~ 1569)등의 영향으로 높이 평가됐다. 대 피터르 브뤼헐은 보스와 비슷한 양식으로 《죽음의 승리》(1592년)등 여러 점을 그렸다. 보스는 20세기 초현실주의 운동에 영향을 끼쳤다 할 수 있다.'),(26,'William_Turner','낭만주의','영국','조지프 말로드 윌리엄 터너(영어: Joseph Mallord William Turner 1775년 4월 23일 ~ 1851년 12월 19일)는 영국의 화가이다. 런던에서 이발사의 아들로 태어났다.','1775 - 1851','일찍부터 회화에 손을 대어 왕립 미술원에서 그림 수업을 한 뒤, 잠깐 사이에 준회원에서 27세 되던 1802년에 정회원으로 올라갔다. 여러 곳의 풍습과 풍경을 주로 그렸으며, 특히 빛의 묘사에서 획기적인 표현을 남긴 화가이다.\n\n후에 문학가 러스킨이 격찬하여 명성이 높아졌으며, 일생 동안 풍경화를 계속 그린 화가로서 17세기 프랑스의 화가 클로드 로랭을 능가하는 것이 일생의 염원이었다. 그런만큼 중기(中期)에는 로랭의 영향이 보이나 후반에는 여기에서 벗어나 한층 더 빛의 묘사로 들어간다. 터너는 1819년부터 약 10년마다, 세 번 이탈리아로 여행을 갔는데, 물과 하늘, 그리고 빛나는 남국의 태양은 터너의 꿈이요 시였다. 터너는 풍경의 일체를 빛의 묘사에 집중시켜 빛 속에 용해시켜 갔는데, 그것은 균정(均整)이 잡힌 윤곽에서 정중하게 그린, 당시로서는 대담한 창작이었다. 더욱이 그는 다시 창작을 계속하여, 《항구 앞바다의 눈보라》(1843)에서 배의 그림자까지 거칠게 불어대는 태풍 속으로 꺼지는 듯 눈보라의 심한 상태를 주제로 잡고, 과거의 회화에 전례없는 동적인 표현을 그려내고 있다. 작품에는 《차일드 해럴드의 순례》(1832), 《전함 테메레이르호(號)》(1839), 《안개 속의 해돋이》, 《비·증기·속력》, 《황금가지》 등이 있는데, 원숙한 빛의 표현이 아름답다. 이상하게도 제자나 후계자가 없는 화가로서 고독한 성격이었으며, 본가 외에 체르시에 은거하면서 이름을 바꾸어 생활을 했기 때문에 아는 사람도 없이 그 곳에서 숨을 거두었다.'),(27,'Jackson_Pollock','추사 표현주의','미국','폴 잭슨 폴록(영어: Paul Jackson Pollock, 1912년 1월 28일 ~ 1956년 8월 11일)은 미국의 화가로 추상표현주의의 예술가이다. 부인은 추상화가 리 크래스너다.','1912  1956','와이오밍주에서 태어나 로스앤젤레스와 뉴욕에서 공부하였다. 1930년대부터 표현주의에서 초현실주의로 선회했다. 1947년 마루바닥에 편 화포 위에 공업용 페인트를 떨어뜨리는 기법을 창안해 유명해졌다. 이것은 작가의 제작 행위를 직접 화포에 하는 기록이라고 하여 \'액션 페인팅\'이라 불렀다. 대표작으로 〈가을의 리듬〉이 있다.'),(28,'Jan_van_Eyck','북르네상스','폴란드','얀 판 에이크(Jan van Eyck, 1390년경 ~ 1441년)는 플랑드르의 화가이다.','1395 - 1441',' 후베르트 판 에이크의 동생으로, 15세기 북유럽에서 가장 중요한 화가 중 한 사람으로 간주되고 있다.유화 기법을 사용한 최초의 미술가. 그가 색체 가루(안료)를 최초로 기름에 섞어서 사용 때문 자연에 대한 세심한 고찰, 정교한 세부 묘사 대표작은 어린 양에 대한 경배, 아르놀피니 부부의 초상화 1422∼1424년 헤이그의 바이에른후(侯) 요한의 궁정화가, 이어 25년 이래 부르고뉴공(公) 필립[善公]의 궁정화가가 되었다.'),(29,'Joan_Miro','초현실주의','스페인','주안 미로 이 페라(카탈루냐어: Joan Mir? i Ferr? 주안 미로 이 페라[1], 1893년 4월 20일 ~ 1983년 12월 25일)은 스페인 카탈루냐 지방의 바르셀로나 출신의 화가, 조각가, 도예가이다.','1893  1983','바르셀로나 근처인 몬토로이크에서 출생하여 바르셀로나 미술 학교를 중퇴하고 1919년 파리로 나와 작품 활동을 시작하였다. 초기의 작품에는 사물에 대한 정밀한 형태적 감수성과 친밀감이 드는 서정적인 감동이 조화를 이루고 있다. 1923년부터 바실리 칸딘스키의 영향을 받아 초현실주의 화풍으로 바뀌었다. 그의 작품은 밝고 가벼운 색채와 소박하며 단순한 형식으로 이루어져 신선한 정서가 풍긴다. 1928년에는 네덜란드를 여행하였고, 그 해에 미국에서 개인전을 열었다. 1937년 파리 만국 박람회에 출품한 〈추수〉가 유명하다. 1947년 미국으로 건너가 신시내티 호텔 벽화, 하버드 대학 벽화를 그렸다. 1948년 귀국한 후로는 파리와 바르셀로나에서 제작생활을 하였다. 1954년 베네치아 국제전에서 판화 부문 국제상을 받았다. 1983년 12월 25일 성탄절에 90세의 나이로 사망하였다.\n\n미로의 작품에는 초현실주의 특유한 어두운 느낌이나 심리묘사는 적고 밝은 소박성이 특질이며 모두를 순수한 상징기호로 바꾸어 가는 매력이 있다. 대표작으로 〈야곡〉 〈곡립의 귀〉 〈해맑은 웃음〉 등이 있다.'),(30,'Kazimir_Malevich','우월주의','러시아','카지미르 세베리노비치 말레비치(러시아어: Казимир Северинович Малевич, 1879년 2월 23일 ~ 1935년 5월 15일)는 러시아의 화가이다.','1879 - 1935','키예프에서 출생하였고, 초기의 수업은 인상파 및 포비슴에서 출발하였으나 1912년 파리로 나와 퀴비슴을 접하여 결정적인 영향을 받았다. 1913년 백지(白紙)에 검은 정방형만 그린 작품을 발표하여 화제를 일으켰고, 이 작품을 계기로 하여 감각의 궁극을 탐구하는 쉬프레마티슴의 길을 개척해 나갔다. 1915년 시인 블라디미르 마야콥스키의 협력으로 \'쉬프레마티슴 선언\'을 발표하여, 러시아 전위미술의 기수로서 활약하였다. 1919년에는 모스크바 미술학교의 교수가 되었고, 1921년에는 레닌그라드 미술학교의 초청을 받았다. 1926년 그는 단기간 독일에 머물렀는데 귀국 후에 문화정책을 변경한 당국에 의하여 공직서 추방당하였고, 그 이후는 오직 실용미술(제도·직물·벽지)의 분야에만 종사하다가 1935년 레닌그라드에서 사망하였다.'),(31,'Leonardo_da_Vinci','전성기 르네상스','이탈리아','레오나르도 디 세르 피에로 다 빈치(이탈리아어: Leonardo di ser Piero da Vinci, 1452년 4월 15일 ~ 1519년 5월 2일)는 이탈리아 르네상스를 대표하는 석학(polymath)이다. 화가이자 조각가, 발명가, 건축가, 해부학자, 지리학자, 음악가였다.','1452 - 1519','2007년 11월에 네이처 지가 선정한 인류역사를 바꾼 10명의 천재중에 가장 창의적인 인물 1위를 레오나르도 다빈치가 차지했다.[1] 네이처는 과학 전문지이기 때문에 당연히 과학자를 1위에 뽑을것이라는 모두의 예상을 뒤엎는 결과였으며 2위는 세익스피어였고, 과학자인 아이작 뉴턴은 간신히 6위를 차지했다. 르네상스형 만능인 다빈치가 역사상 가장 창의적인 융합형 인재로 평가된것이다. 그는 평생 기술과 과학 그리고 예술을 하나로 융합하려는 창의적인 노력을 끊임없이 하였다.\n\n그의 여러 작품중 오늘날 가장 유명한 것은 모나리자이다. 모나리자 없이는 루브르 박물관을 논할 수 없다는 평가가 존재할 정도로 모나리자라는 작품이 차지하는 비중은 크며, 전세계적으로도 가장 널리 알려진 매우 유명한 그림이다. 그외에도 \'최후의 만찬\'은 그의 대표작으로 세기의 명작으로 손꼽을 수 있다.'),(32,'Marc_Chagall','원시주의','프랑스,벨라루스','마르크 샤갈(Marc Zakharovich Chagall, 1887년 7월 7일 ~ 1985년 3월 28일)은 러시아 제국(현 벨라루스)에서 태어난 프랑스의 화가이다. 파블로 피카소와 함께 20세기 최고의 화가로 불린다.','1887 - 1985','샤갈은 1887년 7월 7일 러시아 제국 리오즈나(현재 벨라루스)에서 유대인계 가난한 집안에서 출생하였다.[1] 그가 태어나던 당시 비테브스크의 인구는 약 66,000명 정도였고, 그 중 절반이 유대인이었다.[2] 그림같은 교회당과 유대교회가 있었고, 옛 스페인 제국의 문화의 중심지로 그곳은 러시아의 톨레도라고 불렸다. 대부분의 건물이 목조건물이었으므로, 그것들 중 어떤 건물도 3년 후 나치의 침공 때 보존되지 못하고, 제2차 세계대전 때 파괴되었다.\n\n샤갈은 9형제 중 맏이었으며, 그의 성 샤갈은 보통 유대가정에서 태어나면 다양한 유사 이름을 가진다.[3] 그의 아버지 카츠키 샤갈은 청어상인 밑에서 일을 했고, 그의 어머니는 집에서 야채를 파는 상인이었다. 그의 아버지는 중노동을 하면서 열심히 일했지만, 한 달 수입은 20루블에 지나지 않았다. 이후 샤갈은 \"\"존경받지 못하는 그의 아버지\"\"를 생선 모티브를 포함하여 표현한다.\n\n1906년에 당시 러시아 제국의 수도이자 예술의 중심지였던 상트페테르부르크로 이사를 갔으며, 그곳에는 많은 유명한 예술학교들이 있었다. 유대인들은 통행증이 없으면, 출입이 허가되지 않았으므로, 그는 가까스로 친구에게서 임시통행증을 얻었다. 그는 그곳의 명문 예술학교에 등록을 해서 2년을 공부했다.[4] 1907년 경에는 자연주의적 초상화와 풍경화를 그렸다.\n\n1908년에서 1910년까지 샤갈은 짜반체바 미술학교에서 레온 박스트에게서 공부를 했다. 그곳에 있는 동안 그는 실험극장과 폴 고갱의 작품들을 접하게 되었다.[5] 박스트도 유대인이었으며, 또한 장식예술 디자이너였고, 유명한 발레 무대배경과 의상 디자이너였다. 샤갈은 박스트를 성공한 유대인의 롤모델로 삼았다. 1년 후 박스터는 파리로 이사를 갔다. 예술 역사가 레이먼트 코그니에는 \"\"샤갈은 당시 주류 예술로 접어들었으며 .... 그의 도제 생활은 끝났고, 러시아는 그의 삶에서 중요한 초기의 경험을 던져주었다\"\"고 썼다.[6]\n\n샤갈도 1910년까지 상트페테르부르크에 머물렀는데, 종종 비테브스크를 갔다가 벨라 로젠펠트를 만나 사랑에 빠진다. \"\"나의 삶\"\"이라는 글에서 샤갈은 그녀와의 첫만남을 다음과 같이 썼다. \"\"그녀의 침묵은 내것이었고, 그녀의 눈동자도 내것이었다. 그녀는 마치 내 어린시절과 부모님, 내 미래를 모두 알고 있는 것 같았고, 나를 관통해 볼 수 있는 것 같았다.[4]\n\n시골의 미술 학교를 거쳐 페테르스부르크 왕실 미술 학교를 졸업하고, 1910년 파리에 유학을 떠났다. 아카데미 쥘리앙에서 공부하면서 피카소와 입체파의 영향을 받았다.'),(33,'Michelangelo','전성기 르네상스','이탈리아','미켈란젤로 디 로도비코 부오나로티 시모니(이탈리아어: Michelangelo di Lodovico Buonarroti Simoni, 1475년 3월 6일 ~ 1564년 2월 18일)는 르네상스 시대 이탈리아의 대표적 조각가, 화가, 건축가 그리고 시인이었다.','1475  1564','미켈란젤로는 유년 시절부터 조토와 마사치오의 작품들을 습작하며 그림에 많은 관심을 쏟아 집안에서 자주 꾸중을 들었다. 계몽사에서 출판한 《미켈란젤로》(이효성 지음, 최주훈 그림)에 의하면 , 소년 미켈란젤로의 재능을 알아본 메디치 가에서 아버지를 설득한 덕분에 미켈란젤로는 미술공부를 할 수 있었고, 13세 때 화가 도메니코에게서 그림을 배웠다.14세때부터 메디치 가문의 보호를 받으며 베르트르드 디 조반니를 통하여 도나텔로 작품을 배웠다.[1] 또한 성 베드로 대성전의 돔, 성 베드로 대성전의 피에타, 팔레스티나의 피에타, 론다니니의 피에타 등 세 조상을 미완성으로 남긴 채 89세를 일기로, 외롭고 괴로운 긴 생애를 로마에서 마쳤다.'),(34,'Mikhail_Vrubel','상징주의','러시아','미하일 브루벨(, 1856년 3월 17일 ~ 1910년 4월 14일)은 러시아 화가이다. 1896년 브루벨은 유명한 가수 나데즈다 자벨라-브루벨과 결혼하였다.','1856 - 1910','소련의 역사가 니나 드미트리에바는 브루벨의 예술 전기를 프롤로그와 에필로그가 있는 3막짜리 드라마에 비유했지만, 연극 사이의 변화는 빠르고 예상치 못했다. \"\"프롤로그\"\"는 그가 공부를 하고 진로를 선택했던 어린 시절을 언급하고 있다. 1막은 1880년대 브루벨이 제국 예술 아카데미에서 공부하던 때 절정에 달했고, 그 후 키예프로 건너가 비잔틴과 기독교 미술을 공부했다. 제2막은 1890년 그림 \"악마가 앉은 자리\"로 시작하여 1902년 \"악마의 몰락\"으로 끝난 이른바 \"모스크바 시대\"에 해당한다. \"\"제3막\"\"은 1903년부터 1906년까지 지속되었는데, 이때 브루벨은 정신병을 앓아 점차 신체적, 지적 능력을 약화시켰다. 이미 장님이 된 브루벨은 인생의 마지막 4년 동안 육체적으로만 살았다.[1]\n\n1880-1890년 사이, 브루벨의 창조적인 열망은 제국 예술 아카데미와 예술 비평가들의 지지를 얻지 못했다. 그러나 유명한 마에체나 사바 마몬토프를 포함한 많은 개인 수집가들과 후원자들은 미르 이스쿠스트바 저널을 중심으로 뭉친 화가들과 비평가들을 포함하여 그의 그림에 매료되었다. 결국 브루벨의 작품들은 미르 이스쿠스트바의 미술 전시회와 세르게이 디아길레프 회고전에 전시되었다. 20세기 초에, 브루벨의 예술은 러시아 아르누보의 유기적인 부분이 되었다. 1905년 11월 28일, 그는 \"\"예술 분야에서의 명성\"\"으로 회화 아카데미안이라는 칭호를 받았다.'),(35,'Pablo_Picasso','입체파','스페인','파블로 루이스 피카소(스페인어: Pablo Ruiz Picasso, 1881년 10월 25일 ~ 1973년 4월 8일)는 스페인 말라가에서 출생하였고 주로 프랑스에서 미술활동을 한 20세기의 대표적 큐비즘 작가로 널리 알려져 있으며, 대표작으로 《아비뇽의 처녀들》, 《게르니카》 등이 있다.','1881 - 1973','피카소는 1만 3,500여 점의 그림과 700여 점의 조각품을 창작했다. 그의 작품 수를 전부 합치면 3만여 점이 된다. 피카소 작품의 개수와 다양성 때문에 많은 예술사가들이 그의 작품들을 시기별로 분류하는 작업을 시도해왔다. 하지만 각 시기의 명칭을 정하고 시기를 몇 개로 나눌 것 인가를 놓고 계속 의견이 대립되고 있다.\n\n1904년 피카소는 이른바 \'장밋빛 시대\'를 맞는다. 이 시기의 작품들 역시 피카소가 파리에 머물 때 그려졌지만, 오늘날 그것들은 그의 초기 작품들과는 달리 스페인 화풍이 아니라 프랑스 화풍에 가까운 것으로 평가되고 있다. 이 2년의 기간 동안 피카소는 전과는 달리 붉은 색과 분홍 색을 많이 사용했다. 이러한 변화가 일어난 것은 그가 많은 그림들의 주제로 삼았던 페르낭드 올리비에와의 로맨스 때문이라는 의견이 지배적이다.\n\n피카소는 주로 프랑스에서 활동하였지만, 프랑스 정부에서 사회주의자로 분류되어 프랑스 시민권을 갖지는 못했다.\n\n피카소는 스탈린을 익살스럽게 그린 그림이 스탈린에 대한 조롱으로 해석되어 1957년에 제명되기까지 프랑스 공산당원으로 활동한 사회주의자였으며, 한국 전쟁에서 벌어진 미국의 잔학행위(예:미군이 충청북도 영동군 노근리에서 한국인들을 전투기와 기관총으로 학살한 노근리 학살)에 대해서 비판하였다. 1951년 그는 \'한국의 학살\'(Massacre in Korea)을 발표하였고, 유엔과 미국의 한국전쟁의 개입을 반대하였다. 1973년 92세의 나이로 세상을 떠났다.\n\n피카소는 미술 활동을 통하여 사회적 문제를 알렸다. 대표적으로 스페인 내전에서 게르니카 민간인들이 나치 독일 공군의 폭력으로 학살당한 게르니카 학살사건(1938년)을 고발한 《게르니카》가 있다.'),(36,'Paul_Cezanne','후기-인상주의','프랑스','폴 세잔(프랑스어: Paul C?zanne, 문화어: 폴 세쟌느, 1839년 1월 19일 ~ 1906년 10월 22일)은 프랑스의 대표적 화가로서 현대 미술의 아버지이다.','1839  1906','세잔가는 서부 Piedmont에 있는 Cesana라는 마을에 살았다. 그들의 성 세잔은 본래 이탈리아에서 유래된 이름이다. 폴 세잔은 1839년 1월 19일, 남프랑스에 있는 액상프로방스에서 태어났다. 태어나고 약 한달 뒤인 1839년 2월 22일에는 그의 할머니를 대모로, 삼촌인 Louis를 대부로 성당에서 세례를 받았다. 그의 아버지인 루이스 아우구스테 세잔(Louis-Auguste C?zanne - 28 July 1798 ? 23 October 1886)은 한 은행의 공동창업자였는데, 이 은행은 폴 세잔이 살아있는 동안 번영하여 폴의 경쟁자들에겐 불가능했던 경제적인 지원을 지속적으로 받을 수 있었다. 결과적으로 폴은 큰 유산을 상속받을 수 있었다. 그러나 반대로 그의 어머니였던Anne Elisabeth Honorine Aubert (24 September 1814 ? 25 October 1897)는 로맨틱하고 명량했지만 범죄를 저지르는데 빨랐다. 폴이 그의 인생에 대한 방향과 비전을 잡는데 그의 어머니로 영감을 얻었다. 그에겐 매일 초등학교를 함께 다니던 매리(Marie)와 로즈(Rose), 두 여동생이 있었다.폴이 열살이 되던 해에 그는 Aix에 있는 성 요셉 학교에 입학했다.'),(37,'Paul_Gauguin','상징주의,후기-인상주의','프랑스','폴 고갱(Paul Gauguin, 1848년 6월 7일 ~ 1903년 5월 8일)은 프랑스의 탈인상주의 화가이다.','1848  1903',' 파리에서 태어났다. 생전에는 그리 평가받지 못하였으나 오늘날에는 인상주의를 벗어나 종합주의 색체론에 입각한 작품을 남긴 화가로 널리 인정받고 있다. 생의 마지막 10여년을 타히티를 비롯한 프랑스령 폴리네시아에서 생활하며 작업하였고 이 시기 작품이 그의 대표작이 되었다.\n\n고갱의 작품은 파블로 피카소나 앙리 마티스와 같은 프랑스 아방가르드 작가들에게 영감을 주었다. 고갱 사후 파리의 아트딜러 앙브루아즈 볼라르는 두 번의 유작전을 파리에서 개최하였고 그제서야 명성을 얻게 되었다.[1][2] 고갱은 상징주의를 대표하는 인물 가운데 하나로 회화뿐만아니라 조각, 판화, 도예, 저술 등의 다방면에서 작품을 남겼다. 고갱의 화풍은 클루아조니즘으로부터 많은 영향을 받았으며 대표작들의 주제는 원시주의에 바탕을 두었다.'),(38,'Paul_Klee','표현주의,추상주의,초현실주의','독일,스위스','파울 클레 (Paul Klee, 1879년 12월 18일 - 1940년 6월 29일)는 스위스 화가이다','1879  1940','적은 독일이다. 그의 작품은 표현주의, 입체파, 초현실주의 등 여러 다양한 예술 형태의 영향을 받았다. 그와 그의 친구인 러시아 화가 칸딘스키는 예술과 건축의 학교인 바우하우스에서 학생들을 가르친 것으로 유명하다.'),(39,'Peter_Paul_Rubens','바로크','벨기에','페테르 파울 루벤스(Peter Paul Rubens, 1577년 6월 28일 ~ 1640년 5월 30일)는 독일 태생으로 17세기 바로크를 대표하는 벨기에 화가이다.','1577 - 1640','루벤스라는 이름으로 널리 알려져 있는 그는 역동성, 강한 색감, 그리고 관능미를 추구하는 환상적인 바로크 스타일의 대표적인 화가이기도 했다. 루벤스는 초상화, 풍경화, 신화나 사실을 바탕으로 그린 역사화, 그리고 교회 제단을 위해 그린 반종교개혁적인 세 폭 제단화인 〈십자가에서 내려지는 그리스도〉라는 작품으로 유명하다.'),(40,'Pierre-Auguste_Renoir','인상주의','프랑스','오귀스트 르누아르(Auguste Renoir, 1841년 2월 25일 ~ 1919년 12월 3일)는 프랑스의 대표적인 인상주의 화가로, 여성의 육체를 묘사하는 데에 있어 특출난 표현을 선보였으며 풍경화에도 뛰어났다. ','1841 - 1919','인상파 중에서 세잔의 엄격에 대비되는 가장 아름답고 뛰어나게 화려한 멋을 보인 것은 르누아르이다. 세잔이 풍경 속에 자연의 정신을 품듯이 르누아르는 여인을 그려서 미의 도취를 자아내고 있다.'),(41,'Piet_Mondrian','신플라스틱주의','네덜란드','피에트 코르넬리스 (피트) 몬드리안(Pieter Cornelis (Piet) Mondriaan, 1912년 이후에는 Mondrian으로 철자를 바꿈, 네덜란드어 IPA: [pi:t \'m?ndria:n], 이후 IPA: [pi:t \'m?nd?i?n], 1872년 3월 7일 ~ 1944년 2월 1일)은 네덜란드의 근대 미술 화가이다.','1872  1944','몬드리안은 추상화의 초기 화가에 속하며, 네덜란드 구성주의 회화의 거장이다. 빈센트 반 고흐와 야수파에서 많은 영향을 받은 예술가이다.\n\n몬드리안은 테오 판 두스부르흐가 만든 데 스틸(De Stijl) 예술 운동의 중요한 구성원이다. 그는 자신이 신조형주의(Neo-Plasticism)라고 부른 비구상적인 형태를 발전시켰다. 그의 그림들은 가로와 세로의 검은 선의 격자(grid)와 삼원색을 사용한 것들이 많다.'),(42,'Pieter_Bruegel','북르네상스','폴란드','피터르 브뤼헐 더 아우더(네덜란드어: Pieter Brueghel de Oude, 1527년경 - 1569년 9월 30일)은 브라반트 공국의 화가이다.','1525 - 1569','북유럽 르네상스의 대표적 화가인 그는 태어난 마을 이름을 따 성을 삼았다. 1551년 안트베르펀의 화가 조합에 들어간 후, 이탈리아·프랑스에서 유학하였다. 처음에는 \'민간 전설\'이라는 속담 등을 주제로 하여 그림을 그렸고, 후에 네덜란드에 대한 에스파냐의 억압을 종교적 제재로써 극적으로 표현하였으며, 이어서 농민 생활을 애정과 유머를 담아서 사실적으로 표현하였으므로 \'농민의 브뤼겔\'이라고 불리었다. 여기서의 풍경 묘사는 풍경화 역사에서 중요한 위치를 차지하고 있다. 작품은 동판화 1점을 포함하여 45점이 알려졌지만 〈장님〉, 〈바벨의 탑〉, 〈농부의 혼인〉, 〈눈 속의 사냥꾼〉 등이 특히 유명하다.\n\n그는 작품에 서명과 날짜를 기입하는 습관을 가지고 있었는데 1559년부터는 작품 서명에 ‘h’를 빼고 ‘Bruegel’로 적었다.\n\n큰 아들 피터르 브뤼헐 더 용어(Pieter Brueghel de Jonge)과 작은 아들 얀 브뤼헐 더 아우더(Jan Brueghel de Oude)도 유명한 화가이지만, 아버지로부터 미술교육을 받지는 않았다. 장남 소 피터르는 아버지와 같은 제재의 작품 외에, 환상적·악마적 화면을 즐겨 그려 \'지옥의 브뤼헐\'이라고 불리었으며, 차남 얀은 화초나 풍경을 잘 그려 \'꽃의 브뤼헐\', \'천국의 브뤼헐\'이라 불리었다.'),(43,'Raphael','전성기 르네상스','이탈리아','라파엘로 산치오 다 우르비노(이탈리아어: Raffaello Sanzio da Urbino, 1483년 4월 6일 ~ 1520년 4월 6일)는 르네상스 시대 이탈리아의 예술가·화가이며, 흔히 라파엘로(Raffaello)라고 불린다.','1483  1520','《아테네 학당》이 특히 유명하다. <아테네 학당>은 에피쿠로스, 피타고라스, 안티스테네스 등 고대 그리스의 학자가 학당에 모인 것을 상상해서 그린 그림이다.'),(44,'Rembrandt','바로크','네덜란드','렘브란트 하르먼손 반 레인(네덜란드어: Rembrandt Harmenszoon van Rijn, 1606년 7월 15일 ~ 1669년 10월 4일)은 바로크 시대의 네덜란드 화가이다. ','1606 - 1669','빛의 화가라고도 불리는 그는 일반적으로 유럽 미술사에서 가장 위대한 화가이자 판화가 중 한 사람으로 여겨지며 특히 네덜란드의 역사에서 가장 중요한 화가이기도 하다.[1] 예술 분야에서 그의 기여는 역사가들이 소위 네덜란드 황금 시대라고 부르는 시대를 불러오게 하였다.'),(45,'Rene_Magritte','초현실주의,인상주의','벨기에','르네 프랑수아 길랭 마그리트(1898년 11월 21일~1967년 8월 15일, 프랑스어: Ren? Fran?ois Ghislain Magritte)는 초현실적인 작품을 많이 남긴 벨기에의 화가이다. 대표작으로 \"\"이것은 파이프가 아니다\"\"로 유명한 《이미지의 배반》이 꼽히며, 이 외에도 《골콩드》, 《중산모를 쓴 남자》, 《이것은 사과가 아니다》 등이 널리 알려져 있다.','1898 - 1967','1898년 11월 21일에 벨기에에서 태어나 1967년 8월 15일에 사망하였다. 1916년 브뤼셀에서 미술공부를 시작했고, 1920년 중반까지 미래주의와 입체주의 성향의 작품을 그렸다. 그러나 그 이후 조르조 데 키리코(Giorgio de Chirico)의 영향을 받아 초현실주의적인 작품을 제작하기 시작하였다. 그는 초현실주의적이지만 자신만의 개성이 두드러지는 작품들을 제작했다. 주로 우리의 주변에 있는 대상들을 매우 사실적으로 묘사하고 그것과는 전혀 다른 요소들을 작품안에 배치하는 방식인 데페이즈망(d?paysement) 기법을 사용하였다. 1950년대에는 그 전까지 했었던 작품들과는 완전히 다른 작품을 제작하기도 하는데, 인상주의시기의 르누아르의 영향을 받은 작품들과 바슈(vache)시기의 야수파의 영향을 받은 작품들이 제작되었다. 그의 작품들은 주로 신비한 분위기와 고정관념을 깨는 소재와 구조, 발상의 전환 등의 특징을 보이며 이러한 특징은 우리가 생각하는 모든 것들을 새로운 시선으로 바라보도록 한다.\n\n마그리트의 작품들은 현대미술에서의 팝아트와 그래픽 디자인에 큰 영향을 주었고, 대중매체의 많은 영역에서 영감의 원천이 되고 있다. 영화 \"매트릭스\"는 《겨울비(Golconde)》(1953)이라는 작품에서 영감을 받았고, 영화 \"하울의 움직이는 성\"은 《피레네의 성(Le chateau des Pyrenees)》(1959)과 《올마이어의 성(Almayer`s Folly)》(1951)에서 모티브를 얻었다'),(46,'Salvador_Dali','초현실주의','스페인','살바도르 도밍고 펠리페 하신토 달리 이 도메네크(스페인어:?Salvador Domingo Felipe Jacinto Dal? i Dom?nech,?1904년?5월 11일~1989년?1월 23일)은?스페인의?초현실주의?화가이자?판화가, 영화 제작가이다.','1904 - 1989','그는 카탈루냐의 피게레스(Figueres)에서 출생하였는데, 그의 형 이름 또한 \'살바도르\'였다. 그가 태어나기 9개월 전인 1903년 8월 1일 죽었기 때문에, 그의 아버지\n가 같은 이름을 지어주었다. 그의 아버지의 이름 또한 살바도르였는데 중산층 변호사였다.\n\n마드리드의 미술 학교에서 공부하였다. 1928년 파리로 가서 초현실주의 화가와 작가들과 사귀고, 초현실주의 운동에 참가했다. 그의 수법은 \'환상적 사실주의\'라고 \n도 불린다. 또, 영화 <황금시대>를 제작한 외에 로트레아몽의 시집 <말도로르의 노래>의 삽화를 그렸다.\n\n뒤에 미국에 건너가 정통적 초현실주의를 떠난 후, 가극·발레의 의상 등 장식 예술 분야에서도 활약하였다. 또 디즈니와 협력하여 영화 제작에도 종사하였다. 귀국 \n후의 작품으로 <잉태한 성모>가 있다.[1] 제 2 차 세계대전 후에는 로마 가톨릭교회에 귀의하고 그의 아내인 갈라(Gala Eluard Dal?)를 성모 마리아에 비유한 종교 \n화를 연작했다. 갈라는 달리의 뮤즈이자 통치자이자 매니저였다. 그는 또한 독일의 히틀러를 찬양해 다른 초현실주의자들의 비난을 받았다. 그의 히틀러에 대한 숭 \n모는 다음과 같은 글에 잘 나타나 있다.'),(47,'Sandro_Botticelli','초기 르네상스','이탈리아','티치아노 베첼리오(이탈리아어: Tiziano Vecellio, 1488-90년경 ~ 1576년)는 북이탈리아 피에베 디 카도레에서 출생한 이탈리아의 전성기 르네상스 시대에 활약했던 화가이다.','1445 - 1510','본명은 알레산드로 디 마리아노 필리페피(Alessandro di Mariano Fillipepi)이지만, \'작은 술통\'이라는 뜻을 가진 보티첼리라는 이름으로 더 잘 알려져 있다.     \n\n메디치 가문과 그 가문의 추종자들의 이미지를 각인시킨 그의 초상화가 아주 중요한 의미를 지닌다. 그의 후기 작품은 고딕 양식을 재수용하면서 감정적으로 강한 \n표현을 드러내는 특징을 지녔다. 그의 회화가 지니고 있는 몇 가지 요소를 19세기 라파엘 전파의 화가들이 재수용했고, 유겐트슈틸도 선과 장식을 처리하는 방식에\n서 그로부터 몇 가지를 차용하기도 했다. 그의 아버지인 마리아노 디 반니(Mariano di Vanni)는 제혁업자이다.'),(48,'Titian','전성기 르네상스,매너리즘','이탈리아','티치아노 베첼리오(이탈리아어: Tiziano Vecellio, 1488-90년경 ~ 1576년)는 북이탈리아 피에베 디 카도레에서 출생한 이탈리아의 전성기 르네상스 시대에 활약했던 화가이다.','1488 - 1576','그의 창작 시기는 베네치아 공화국 회화의 황금기와 맞아 떨어졌다. 그 당시 베네치아는 경제적, 문화적 전성기를 구가하고 있었다. 티치아노는 9살이 되었을 때 베네치아로 가서 젠틸레 벨리니와 조반니 벨리니 형제에게 사사했다. 1513년 그는 산 사물엘레에 자신의 작업장을 열었고, 유럽 전역에서 찬양을 받는 화가로 발전했다. 1515년경에는 명백한 베네치아 화파의 거장이 되어 지식인들의 찬사를 들었고 소장가들의 찬미를 받았으며 귀족이나 궁정의 부름을 더 많이 받게 되었다. 1520년대에 그의 명성이 퍼져나가기 시작하면서 베네치아에서 주로 의뢰를 받는 것 외에도 , 피에트로 아레티노를 사실상의 ‘대행인’삼아 유럽에서 가장 각광받는 초상화가로서 입지를 세웠다[1]. 1533년 그는 신성 로마 제국 황제였던 카를 5세로부터 귀족 작위를 받고 그의 궁정 화가로 임명되었다. 1545년 티치아노는 교황 바오로 3세의 초청을 받아서 로마를 방문했다. 그곳에서 그는 미켈란젤로를 만났다.[2] 1548년과 1550년 티치아노는 카를 5세와 그의 아들 펠리페 2세를 따라서 제국 의회가 있는 아우크스부르크에 갔다. 상당히 고령이었던 티치아노가 1576년 페스트로 죽었을 때 그는, 베네치아 역사상 가장 성공적인 화가였다.\n\n동시대 사람들로부터 \'별 가운데 있는 태양\'이라고 불렸던 티치아노는 646점의 작품을 제작한 그사 살던 시대에 다양한 면모를 보이고, 아주 생산적인 화가 중의 한 사람이었다. 그는 초상화, 풍경화, 신화적 소재를 다루고 종교적 주제를 담은 작품들을 제작했다. <성스런 사랑과 세속의 사랑>, <성모 승천>, <바쿠스의 축제>,〈우르비노의 비너스〉등이 가장 잘 알려진 작품들이었다. 그의 작품의 특징을 이루는 것은 분명하게 드러나는 색채주의며, 그는 일생 동안 그런 특징을 유지했다. 기나긴 생애의 마지막 무렵 그는 극적인 양식의 단절을 완수했고, 그것은 이미 바로크적 특성을 향해 있었다.\n\n살아 있는 동안에도 티치아노의 작품은 모든 중요한 수집품, 예를 들면 바티캄 미술 소장품에 포함되어 있었다. 대귀족, 데스테 가문, 곤차가 가문, 파르네세 가문, 합스부르크 가문과 같은 지배자 귀족 가문들도 자신들의 소장품을 위해서 수 많은 작품을 사들였다. 티치아노의 작품은 그가 살아 있던 동안에도 판화와 복사본의 형태로 수용되었다. 랑베르 수스트리스(Lambert Sustris)나 자코포 틴토레토(Jacopo Tintoretto)와 같이 16세기의 명망있던 화가들은 그를 모범으로 삼았다. 그의 화법과 특히 그의 색채 처리는 그의 동시대 화가들만이 아니라 후세대의 화가들에게도 강력한 영향을 미쳤다. 그에게서 영향을 받은 화가들의 범위는 페터 파울 루벤스에서부터 시작해서 앙투안 와토를 거쳐 외젠 들라크루아까지 이어졌다.'),(49,'Vincent_van_Gogh','후기-인상주의','네덜란드','빈센트 빌럼 반 고흐(네덜란드어: Vincent Willem van Gogh 네덜란드어 발음: [?v?ns?nt ???l?m v?ŋ ???x] ( 듣기), 1853년 3월 30일 ~ 1890년 7월 29일)는 네덜란드 화가로 일반적으로 서양 미술사상 가장 위대한 화가 중 한 사람으로 여겨진다. 그는 그의 작품 전부(900여 점의 그림들과 1100여 점의 습작들)를 정신질환(측두엽 기능장애로 추측됨)을 앓고 자살을 감행하기 전의 단지 10년 동안에 만들어냈다. 그는 생존기간 동안 거의 성공을 거두지 못하고 사후에 비로소 알려졌는데, 특히 1901년 3월 17일 파리에서 71점의 반 고흐의 그림을 전시한 이후 그의 명성은 급속도로 커졌다.','1853  1890','반 고흐는 흔히 탈인상주의 화가로 분류 되며, 또한 인상파, 야수파, 초기 추상화, 표현주의에 미친 영향이 막대하며 20세기 예술의 여러 다른 관점에서 보일 수 있다. 암스테르담에 있는 반 고흐 미술관은 반 고흐의 작품과 그의 동시대인들의 작품에 바쳐졌다. 네덜란드의 또 다른 도시인 오테를로에 있는 크뢸러-뮐러 박물관도 상당히 많은 빈센트 반 고흐 그림의 수집을 보유하고 있다.\n\n반 고흐가 그린 몇몇 그림들은 세상에서 가장 비싼 그림들 사이에 순위가 매겨지기도 한다. 1987년 3월 30일에 반 고흐의 그림 \'아이리스\'가 뉴욕의 소더비즈에서 5390만 미국 달러라는 기록으로 팔렸다. 1990년 5월 15일에 그의 \'가셰 박사의 초상\'(첫째판)이 크리스티즈에서 8,250만 달러(한국돈으로 약 580억원)에 일본의 다이쇼와제지 명예회장 사이토 료에이(당시 74세)에게 팔림에 따라, 새로운 최고가 기록을 세웠다. 당시 사이토가 지불한 8,250만 달러는 낙찰가 7,500만달러에 경매가 구전 10%가 가산된 금액이다.[1] 이후 \'가셰 박사의 초상\'은 미국의 수집가에게 4천 400만 달러에 다시 팔렸다.'),(50,'Vasiliy_Kandinskiy','표현주의,추상주의','러시아','바실리 바실리예비치 칸딘스키(러시아어:?Василий Васильевич Кандинский,?1866년?12월 16일~?1944년?12월 13일)는?러시아의 화가, 판화제작자, 예술이론가이다.?피카소와?마티스와 비교되며 20세기의 중요한 예술가 중의 하나로 평가되는 그는 초기?추상미술의 주요 인물 중 한명이다. 일반적으로 그는 최초의 현대추상작품을 그린 작가로 평가된다.','1866 - 1944','모스크바에서 출생해 오데사에서 어린 시절을 보냈다. 모스크바 대학에서 법과 경제를 배웠고, 전문가로서 인정받아 대학교수가 되었다. 거기에서 30세 때에 그림 공부를 시작하여, 모델 데생, 스케치, 해부학을 배웠다.\n1896년에 뮌헨에 정착하여 사립학교와 미술 아카데미에서 수학하였다. 러시아 혁명이 끝난 1918년에 모스크바로 돌아왔으나, 모스크바의 예술 이론에 동의하지 않아 모스크바 미술아카데미의 교수직을 버리고 1921년에 독일로 돌아왔다.\n1922년에서 1933년까지 예술과 건축을 위한 학교인 바우하우스에서 학생들을 가르쳤다. 그가 담당한 것은 벽화 공방이었는데, 이후 바우하우스가 바이마르에서 데사우로, 나아가서 사학으로 격하되어 베를린으로 이전하고 1933년 정치적 압력으로, 나치로 인해 폐쇄당하는 날까지 계속 그 자리에 있었으며, 바우하우스의 말기에는 부교장의 자격으로서 널리 신망을 모았다고 전해진다.\n이후에는 프랑스로 옮겨 여생을 살았으며, 1939년에 프랑스국적을 취득하였고 1944년 파리 근교 뇌이쉬르센(프랑스어: Neuilly-sur-Seine)에서 사망하였다.');
